import React from "react";
import FormattedTime from "./FormattedTime";

export default function SunriseSunset(props) {
return (
    <div class="row">
      <div class="col-2"></div>
      <div class="col-2"></div>
      <div class="col-2" id="sunrise">
        <img id="sunrise-icon" src="images/SUNRISE.png" />
        <span id="sunrise-time">
          <FormattedTime date={props.data.sunrise} />
        </span>
      </div>
      <div class="col-2" id="sunset">
        <img id="sunset-icon" src="images/SUNSET.png" />
        <span id="sunset-time">
          <FormattedTime date={props.data.sunset} />
        </span>
      </div>
    </div>
  );
}
